import React from "react";
import "tailwindcss/tailwind.css";
import MenuIcon from "@mui/icons-material/Menu";
import SearchIcon from "@mui/icons-material/Search";
import ShoppingCartOutlinedIcon from "@mui/icons-material/ShoppingCartOutlined";
import { IconButton } from "@mui/material";


const Header = () => {

  const [issearch, setisSearch] = useState(false);

  return (
    <header className=" fixed top-0 left-0 z-[100] w-full p-2 bg-my-background flex items-center justify-between drop-shadow-header-shadow">
      {/* left side */}
      <div className="flex">
        <IconButton
          sx={{
            color: "red",
          }}
        >
          <MenuIcon
            sx={{
              color: "green",
            }}
          />
        </IconButton>
        <h4 className="m-2 text-sm font-bold ">LearnS</h4>
        <div className="flex">
          <input type="text" placeholder="Search" className="mr-3 hidden sm:inline-block  ml-1 outline-none p-2 font-semibold text-sm w-[200px] " />
          <SearchIcon className="m-2"/>
        </div>
      </div>
      {/* right side */}
      <ShoppingCartOutlinedIcon />
    </header>
  );
};

export default Header;
